export const setLocalStorage=(key,data)=>{
    if (key && data) {
        
        localStorage.setItem(key,data);
    }

}

export const getLocalStorage={
    if (key) {
        
      const userkey = localStorage.getItem(key.userDzfoodLoginToken);
    }

}
